import React from 'react';
import VideoPlayer from './VideoPlayer';
import Formations from './Formations';
import './App.css';

const [showFormations, setShowFormations] = useState(false);

const toggleFormations = () => {
  setShowFormations(!showFormations);
};


const App = () => {
  return (
    <div className="app-container">
      <header className="app-header">
        <h1 className="title">YouTube Video Player</h1>
        <button onClick={toggleFormations}>Formations</button>
      </header>
      {showFormations && <Formations />}
      <main className="app-content">
        <VideoPlayer />
      </main>
      <footer className="app-footer">
        <p>&copy; 2023 Your App Name. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default App;
